        public static void Main()
        {
            Console.Write("Part ? ");
            string choice = Console.ReadLine();
            if (choice == "1")
            {
                Part1();
            }
            else if (choice == "2")
            {
                Part2();
            }
            else
            {
                Console.WriteLine("Not possible..");
                Main();
            }
        }
        public static void Part1()
        {
            char[,] rockMap = BuildRockMap(Printers.InitiateCharMap(170, 50), 480);

            bool onMap = true;
            int unitCount = 0;

            while (onMap)
            {
                int row = 0;
                int col = 20;
                bool down = true;
                bool downLeft = true;
                bool downRight = true;
                do
                {
                    do
                    {
                        do
                        {
                            //down
                            if (rockMap[row + 1, col] != '#' && rockMap[row + 1, col] != '0')
                            {
                                row++;
                                downLeft = true;

                            }
                            else
                            {
                                down = false;
                            }
                        } while (down);

                        if (!down && rockMap[row + 1, col - 1] != '#' && rockMap[row + 1, col - 1] != '0')
                        {
                            row++;
                            col--;
                            down = true;
                        }
                        else
                        {
                            downLeft = false;
                        }
                    } while (downLeft);

                    if (!down && !downLeft && rockMap[row + 1, col + 1] != '#' && rockMap[row + 1, col + 1] != '0')
                    {
                        row++;
                        col++;
                        down = true;
                        downLeft = true;
                    }
                    else
                    {
                        downRight = false;
                    }

                } while (downRight);

                rockMap[row, col] = '0';
                unitCount++;
                Console.Clear();
                Printers.DrawCharMap(rockMap, false);

            }

        }
