        public static char[,] AlterRockMap(char[,] map, int[] startpoint, int direction, int distance)
        {

            if (direction == 0) //up
            {
                for (int i = 0; Math.Abs(i) <= distance; i--)
                {
                    map[startpoint[0] + i, startpoint[1]] = '#';
                }
            }
            else if (direction == 2) //down
            {
                for (int i = 0; i <= distance; i++)
                {
                    map[startpoint[0] + i, startpoint[1]] = '#';
                }
            }
            else if (direction == 3) // left
            {
                for (int i = 0; Math.Abs(i) <= distance; i--)
                {
                    map[startpoint[0], startpoint[1] + i] = '#';
                }
            }
            else
            {
                for (int i = 0; i <= distance; i++) //right
                {
                    map[startpoint[0], startpoint[1] + i] = '#';
                }
            }

            return map;
        }

        public static void Part2()
        {
            //GetMaxRow();

            char[,] rockMap = Printers.InitiateCharMap(170, 400);

            rockMap = BuildRockMap(rockMap, 300);
            int[] floorStart = { 167, 0 };
            AlterRockMap(rockMap, floorStart, 1, 399);
            rockMap[0, 200] = '+';
            Printers.DrawCharMap(rockMap);
            bool open = true;
            int unitCount = 0;

            while (open)
            {
                int row = 0;
                int col = 200;
                bool down = true;
                bool downLeft = true;
                bool downRight = true;
                do
                {
                    do
                    {
                        do
                        {   // down
                            if (rockMap[row + 1, col] != '#' && rockMap[row + 1, col] != '0')
                            {
                                row++;
                                downLeft = true;

                            }
                            else
                            {
                                down = false;
                            }
                        } while (down);

                        // down and left
                        if (!down && rockMap[row + 1, col - 1] != '#' && rockMap[row + 1, col - 1] != '0')
                        {
                            row++;
                            col--;
                            down = true;
                        }
                        else
                        {
                            downLeft = false;
                        }
                    } while (downLeft);

                    // down and right
                    if (!down && !downLeft && rockMap[row + 1, col + 1] != '#' && rockMap[row + 1, col + 1] != '0')
                    {
                        row++;
                        col++;
                        down = true;
                        downLeft = true;
                    }
                    else
                    {
                        downRight = false;
                    }

                } while (downRight);

                rockMap[row, col] = '0';
                unitCount++;

                if (unitCount % 500 == 0)
                {
                    Console.WriteLine(unitCount);
                }

                if (row == 0) // source reached
                {
                    open = false;
                }

            }
            Console.WriteLine(unitCount);

        }
